import { React, Component } from 'react';
import '../App.css';

class Card extends Component {
    text = this.props.text || 'text';
    key = this.props.shift_key || 'key';
    render() {
        return (
            <div style={divStyle}>
                <p>Text: {this.text.toUpperCase()}</p>
                <p>Key: {this.key}</p>
            </div>
        );
    }
}

const divStyle = {
    borderColor: '#282c34',
    borderWidth: '1em',
};

export default Card;
